import Link from 'next/link';
import Layout from '../components/Layout';

const PostLink = (props) => (
  <li>
    <Link href="/p/[id]" as={`/p/${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </li>
);
const Index = () => {
  console.log('');
  return (
    <Layout>
      <h1>My Blog</h1>
      <ul>
        <PostLink id="Park" />
        <PostLink id="Han" />
        <PostLink id="Sol" />
      </ul>
    </Layout>
  );
};

export default Index;
